; ----------- Settings --------------

alias -l channel { return #sex } ; The channel that code to work (NO MULTI CHANNELS SUPPORTED)
alias -l bad_file { return badchans.txt } ; The bad channels location file
alias -l ban_kick { return 1 } ; 1 = kick him yes, 0 = no kick just ban
alias -l ban_time { return 300 } ; 0 = permanent, (use seconds only)
alias -l ban_type { return 2 } ; use /help $mask for ban type
alias -l random_delay { return $rands(300,900) } ; From 300 seconds up to 900 in random

; ----------- Settings --------------

ON *:JOIN:$($channel): {
  if ($nick == $me) {
    var %t = $nick($chan,0,r)
    var %i = 1

    while (%i <= %t) { 
      var %n = $nick($chan,%i,r)

      if (%n) && (%n !== $me) { .timer[BCS_ $+ %n $+ _AUTOCHECK] 0 $random_delay recheck_badchan %n }

      inc %i
    }

    return
  }

  if ($me !isop $chan) { return }

  recheck_badchan $nick
}

ON *:PART:$($channel): {
  if ($nick == $me) { .timer[BCS_*_AUTOCHECK] off }
  else { .timer[BCS_ $+ $nick $+ _AUTOCHECK] off }
}

ON *:KICK:$($channel): { 
  if ($knick == $me) { .timer[BCS_*_AUTOCHECK] off }
  else { .timer[BCS_ $+ $nick $+ _AUTOCHECK] off }
}

RAW *:*: {
  if (!$hget(BCS,0).item) || ($status !== connected) { return }

  haltdef

  var %h = $hget(BCS,$2)

  if ($numeric == 318) && (%h) { hdel BCS $2 }

  if ($numeric == 319) && (%h) {
    var %r = $check_badchans($3-)
    var %t = $comchan($2,0)

    if (!%r) || (!%t) { return }

    var %i = 1
    while (%i <= %t) {
      var %c = $comchan($2,%i)

      if ($me ison %c) && ($me isop %c) && ($2 ison %c) {
        inc %knum 1

        var %f = -

        if ($ban_kick) { var %f = %f $+ k }
        if ($ban_time) { var %f = %f $+ u $+ $ban_time }

        ban %f %c $2 $ban_type 4[Banned] (reason: You have been found in ( $+ $numtok(%r,32) $+ ) blacklisted channels ( $+ %r $+ ) -- for more infomation reagarding your ban please contact Kendy for removal -52- [Kick id: $chr(35) $+ %knum $+ ] (Expires in: $duration($ban_time) $+ )
      }

      inc %i
    }

  }
}

alias recheck_badchan {
  ; /recheck_badchan <nickname>

  if (!$1) || ($status !== connected) { return }

  hadd -mu10 BCS $1 1

  whois $1
}

alias -l check_badchans {
  ; $check_badchans(#channel1 #channel2 ...)

  if (!$1) || (!$file($bad_file)) { return }

  var %chans = $fix_badchans($1-)
  var %win = $+(@BCS_,$crc($1-,0))

  if ($window(%win)) { window -c $v1 }

  window -hj10000000000000 %win
  loadbuf %win $qt($bad_file)

  var %t = $line(%win,0)
  var %i = 1

  while (%i <= %t) {
    var %r = $line(%win,%i)

    if (!%r) { goto next }

    if ($istok(%chans,%r,32)) { var %tot = $addtok(%tot,%r,32) | goto next }

    var %z = 1
    while (%z <= $numtok(%chans,32)) {
      var %n = $gettok(%chans,%z,32)

      if (%n) && (%r iswm %n) { var %tot = $addtok(%tot,%n,32) }

      inc %z
    }

    :next
    inc %i
  }

  window -c %win

  return $iif(%tot,$v1,0)
}

alias -l fix_badchans {
  ; $fix_badchans(@#channel1 ~#channel2 ...)

  if (!$1) { return 0 }

  var %t = $numtok($1-,32)
  var %i = 1

  while (%i <= %t) {
    var %o = $gettok($1-,%i,32)

    if (%o) { var %c = $+($chr(35),$right(%o,- $+ $pos(%o,$chr(35),1))) }
    if (%c) { var %tot = $addtok(%tot,%c,32) }

    inc %i
  }

  return $iif(%tot,$v1,0)
}

using UnityEngine;
using UnityEngine.UIElements;

public class ArcanoidBall : MonoBehaviour
{

    public float speed = 5f;
    public bool inMove;

    Rigidbody rb;

    public void RunBall()
    {
        float x = Random.Range(0, 2) == 0 ? -1 : 1;
        rb.velocity = new Vector3(x * speed, speed, 0f);
    }

    public void StopBall()
    {
        rb.velocity = new Vector3(0, 0, 0);
        transform.position = new Vector3(0, -3, 0);
    }

    private void Start()
    {
        rb = GetComponent<Rigidbody>();
    }

    private void OnCollisionEnter(Collision collision)
    {
        if(collision.gameObject.name == "Lose")
        {
            GameManager.instance.lives--;
            GameManager.instance.UpdateUI();
            StopBall();
            GameManager.instance.gameRun = false;
            if (GameManager.instance.lives < 0)
            {
                GameManager.instance.EndGame(false);
                gameObject.GetComponent<Renderer>().enabled = false;
            }
        }
    }
}

const canvas = document.getElementById("game")
const context = canvas.getContext('2d');

const tileCount = 20
const tileSize = 18
let headX = 10
let headY = 10
let appleX = 0
let appleY = 0
let xVelocity = 0
let yVelocity = 0
function clearScreen() {
    context.fillStyle = "black"
    context.fillRect(0, 0, canvas.clientWidth, canvas.clientHeight)
}
function drawGame() {
    if(isGameOver() == true) {
        return
    }
    changeSnakePosition()
    clearScreen()
    drawSnake()
    drawApple()
    setTimeout(drawGame, 1000 / 7)
}
function drawSnake() {
    context.fillStyle = "green"
    context.fillRect(headX * tileCount, headY * tileCount, tileSize, tileSize)
}
// drawSnake()

function keyPressed() {
    if(event.keyCode == 87) { // W
        if(yVelocity == 1) {
            return
        }

        xVelocity = 0
        yVelocity = -1
    }
    if(event.keyCode == 83) { // S

        if(yVelocity == -1) {
            return
        }

        xVelocity = 0
        yVelocity = 1
    }
    if(event.keyCode == 65) { // A
        if(xVelocity == 1) {
            return
        }

        xVelocity = -1
        yVelocity = 0
    }
    if(event.keyCode == 68) { // D
        if(xVelocity == -1) {
            return
        }

        xVelocity = 1
        yVelocity = 0
    }

}
function changeSnakePosition() {
    headX += xVelocity
    headY += yVelocity

    

}
function drawApple() {
    context.fillStyle = "red"
    context.fillRect(appleX * tileCount, appleY * tileCount, tileSize, tileSize)
}
function collisionDetection() {
    if(appleX == headX && appleY == headY) {
       appleX = Math.floor(Math.random() * tileCount)
       appleY = Math.floor(Math.random() * tileCount)
    }
}
function isGameOver() {
    let over = false
    if(xVelocity == 0 && yVelocity == 0) {
        return false
    }
    if(headX < 0) {
        over = true
    }
    if(headX >= tileCount) {
        over = true
    }
    if(headY < 0) {
        over = true
    }
    if(headY >= tileCount) {
        over = true
    }
    return over
}
document.addEventListener('keydown', keyPressed)
drawGame()

procedure TMufasaBitmap.DrawText(txt:String; pt:TPoint; font:TFont;
  color:Int32; align:Int32=0; shadow:Boolean=False; shadowDir:Byte=0); overload;
var
  bit:TBitmap;
  muf:TMufasaBitmap;
  W,H:Int32;
begin
  bit.Init();
  bit.GetCanvas().SetFont(font);
  bit.GetCanvas().GetBrush().SetStyle(bsClear);

  W := bit.GetCanvas().TextWidth(txt);
  H := bit.GetCanvas().TextHeight(txt);
  bit.SetWidth(W+1);
  bit.SetHeight(H+1);

  if align then
    pt := Point(pt.x-W, pt.y);

  muf := self.Copy(pt.x,pt.y,pt.x+W,pt.y+H);
  muf.DrawToCanvas(0,0,bit.GetCanvas());

  if Shadow then
  begin
    bit.GetCanvas().GetFont().SetColor(1);
    case ShadowDir of
      0:bit.GetCanvas().TextOut(0,0,txt);
      1:bit.GetCanvas().TextOut(1,0,txt);
      2:bit.GetCanvas().TextOut(2,0,txt);
      3:bit.GetCanvas().TextOut(2,1,txt);
      4:bit.GetCanvas().TextOut(2,2,txt);
      5:bit.GetCanvas().TextOut(1,2,txt);
      6:bit.GetCanvas().TextOut(0,2,txt);
      7:bit.GetCanvas().TextOut(0,1,txt);
    end;
    bit.GetCanvas().GetFont().SetColor(color);
    bit.GetCanvas().TextOut(1,1,txt);
  end else
  begin
    bit.GetCanvas().GetFont().SetColor(color);
    bit.GetCanvas().TextOut(0,0,txt);
  end;

  muf.LoadFromTBitmap(bit);
  muf.DrawTransparent(pt.x,pt.y,self);

  muf.Free();
  bit.Free();
end;

