int srednia (int*tab, int ile){
    int suma=0;
    for(int i=0; i<ile; i++){
        suma+=tab[i];
    }
    return suma/ile;
}

int main(){
    int ile;
    cout << "Ile liczb losowac i zapisac do tablicy: ";
    cin >> ile;
    int *dTab=0;
    dTab = new int[ile];
    srand(time(NULL));
    for (int i=0; i<ile; i++)
    {
        dTab[i] = rand()%100;
        cout << dTab[i] << endl;
    }
    cout << endl << "Sredani to: "<<srednia(dTab,ile);
    delete [] dTab;
    return 0;
}
